/* Compute "diffusion" process. 
 * Takes in one node that gets clicked on.
 * Then uses edge weights to calculate how 
 * "brightness" on other nodes are effected.
 * which determines how closely related two 
 * companies/industries are. */
function graph_reaction(name) {
    var oldCircles = {};
    for(var key_num = 0; key_num < get_keys(data).length; key_num++) {
    	var key = get_keys(data)[key_num];
        oldCircles[key] = 0;
    }
    oldCircles[name] = 1;

    newCircles = copy_dict(oldCircles);

    for(var iteration = 0; iteration < 8; iteration++) {

        for (var key_num = 0;  key_num < get_keys(oldCircles).length; key_num++) {
        	var key = get_keys(oldCircles)[key_num];
            for(var con_num = 0; con_num < get_keys(data[key]).length; con_num++){

            	var con = get_keys(data[key])[con_num];
            	newCircles[con] += oldCircles[key]*data[key][con] / get_keys(data).length;
            }
        }

        // call the sigmasoid function on each one
        for(var key_num = 0; key_num < get_keys(newCircles).length; key_num++){
        	var key = get_keys(newCircles)[key_num];
        	newCircles[key] = sigmasoid(newCircles[key]);
        }

        oldCircles = copy_dict(newCircles);

        


        console.log(oldCircles);

        shimmer(oldCircles);
    }  

	
    
}

// returns our implimentation of the sigmasoid activation function given an input x
function sigmasoid(x){
	return (2.0 / (1 + Math.pow(Math.E,(-3*x))) - 1);
}


/* Helper method to copy a dictionary. */
function copy_dict(dict) {
    return JSON.parse(JSON.stringify(dict));
}


